import React, { useState, useEffect } from 'react'
import { covidURL } from '../../axios'
import styled from 'styled-components'
import { MDBDataTableV5 } from 'mdbreact'

const Tables = () => {
    const [CountryData,setCdata] = useState([])
    const date =`${new Date().getFullYear()}-${"0" + (new Date().getMonth() + 1)}-${new Date().getUTCDate()}`
    useEffect(() =>
    {
        covidURL.get(`/${date}`)
        .then(resp =>
            {
                setCdata(Object.values(resp.data.dates[`${date}`].countries))
            })
        .catch(err =>
            {
                console.log(err)
            })
    },[date])
    return (
       <TableConatiner>
           <MDBtableWrapper>
                <MDBDataTableV5 borderless >

                </MDBDataTableV5>
           </MDBtableWrapper>
           <MapWrapper>

           </MapWrapper>
       </TableConatiner>
    )
}

export default Tables

const TableConatiner = styled.div`
display:flex;
flex-wrap:wrap;
flex-flow:row;
justify-content:space-between;
width:100%;`
const MDBtableWrapper = styled.div`
flex:1.1;
background-color:pink;`
const MapWrapper = styled.div`
flex:1;
background-color:yellow;`
